void test_fft(void)
{
    float data[10000];
    float sampletime = 1.0f/10000.0f;
    float frequencies[5001];
    float amplitudes[5001];
    float angles[5001];
    FFTRecordedVoltage(data, sampletime, frequencies, amplitudes, angles);
    TEST_ASSERT_EQUAL_FLOAT(0.0f,frequencies[0]);
}

void test_find_array_max_value_index(void)
{
    float array[] = {1.0f,5.0f,10.0f,-5.0f,3.0f};
    uint16_t index = uz_find_array_max_value_index(array,5U);
    TEST_ASSERT_EQUAL(2,index);
}

void test_find_real_index_in_range(void)
{
    float array1[] = {0.0f,1.0f,5.0f,10.0f,5.1f,6.1f,1.0f};
    float array2[] = {0.0f,1.0f,5.0f,1.0f,5.1f,6.1f,10.0f};
    
    uint16_t index =  uz_find_real_index_in_range(array1, 4, 2, 7);
    TEST_ASSERT_EQUAL(3,index);
    index =  uz_find_real_index_in_range(array2, 4, 2, 7);
    TEST_ASSERT_EQUAL(6,index);
}

void test_find_fft_peak_indices(void)
{
    uint16_t order[] = {1,3,5,7,9};
    uint16_t n_order = 5U;
    uint16_t fft_elements = 5001U;
    uint16_t indices_real[n_order];
    uz_find_fft_peak_indices(order, n_order, recorded_fft, fft_elements, indices_real);
    TEST_ASSERT_EQUAL(42,indices_real[0]);
    TEST_ASSERT_EQUAL(125,indices_real[1]);
    TEST_ASSERT_EQUAL(208,indices_real[2]);
    TEST_ASSERT_EQUAL(292,indices_real[3]);
    TEST_ASSERT_EQUAL(375,indices_real[4]);
}

void uz_test_wrap_to_2pi(void)
{
    float angle1 = 40.0f;
    float angle2 = -30.0f;
    float angle3 = 1.0f;
    TEST_ASSERT_FLOAT_WITHIN(2.3009f,uz_wrap_to_2pi(angle1),0.0001);
    TEST_ASSERT_FLOAT_WITHIN(1.4159f,uz_wrap_to_2pi(angle2),0.0001);
    TEST_ASSERT_FLOAT_WITHIN(1.0f,uz_wrap_to_2pi(angle3),0.0001);
}

